function Table({ data }) {
    console.log(data);
    return (
      <div>
        <h2>This is Table</h2>
        {data ? (
          <table>
            <thead>
              <tr>
                <th>ID</th>
                <th>Login</th>
                <th>URL</th>
              </tr>
            </thead>
            <tbody>
              {data.map((item) => (
                <tr key={item.id}>
                  <td>{item.id}</td>
                  <td>{item.login}</td>
                  <td>
                    <a href={item.html_url} target="_blank" rel="noopener noreferrer">
                      {item.html_url}
                    </a>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        ) : (
          <p>Loading...</p>
        )}
      </div>
    );
  }

  export default Table;
